import style from './Card.module.css';

export default function Card(props) {
   const {id, name, status, species, gender, origin, image, onClose} = props
   return (
      <div className={style.div}>
         <button
            onClick={() => onClose(id)}
            className={style.button}
         >
            X
         </button>
         <h2>{name}</h2>
         <h2>{status}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <h2>{origin.name}</h2>
         <img
            src={image}
            alt={name}
            className={style.img}
         />
      </div>
   );
}
